import React from 'react'
import { NavLink } from 'react-router-dom'

function HelpLayout() {
  return (
    <div >
        <div><NavLink to='FAQ' >View FAQ</NavLink>
        <NavLink to='contact' >View Contact</NavLink>
        </div>
        
    </div>
  )
}

export default HelpLayout
